import Photo from './javascript.png'

const Body = () =>{
    return(
  <div className="h-screen bg-white p-16 grid grid-cols-4">
<div className="bg-blue-500 text-white text-center text-5xl py-4 rounded-lg">1</div>
<div className="bg-blue-500 text-white text-center text-5xl py-4 rounded-lg">2</div>
<div className="bg-blue-500 text-white text-center text-5xl py-4 rounded-lg">3</div>
<div className="bg-blue-500 text-white text-center text-5xl py-4 rounded-lg">4</div>
  </div>
    )
}

export default Body;
